import React from 'react';
import Post from './PostCard';
function Posts({postsToDisplay}){
    return(
        <div>
            {
                postsToDisplay.map(post => (
                    <Post
                        post = {post}
                    />
                ))
            }
        </div>
    )
}

export default Posts;
